import React from 'react';

const UserList = ({ users }) => {
  return (
    <div className="overflow-y-auto max-h-96">
      <ul className="space-y-4">
        {users.map(user => (
          <li key={user.id} className="flex items-center p-2 border rounded-md hover:bg-gray-100 transition duration-300">
            <div className="bg-blue-500 rounded-full w-10 h-10 flex items-center justify-center text-white text-lg">
              {user.name.charAt(0).toUpperCase()}
            </div>
            <span className="text-base font-semibold ml-3">{user.name}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default UserList;
